import React from 'react';
import './App.css';

const myclass = require('./classes/primary.json');

class App extends React.Component {
  constructor(props)
   {
    super(props);
    this.state = {id:0, class: myclass};
    this.displayJson = this.displayJson.bind(this);
  }


  displayJson()
  {
    console.log(myclass);

    for (var item in this.state.class.db) {
      console.log(this.state.class.db[item].name);
    }

    this.state.class.db.map(
      (item) => {
        console.log(item[0].name);
      }
    );
  }


  render()
  {
    return(
      <div id="test-a">
        <ul>
          {this.state.count}
        </ul>
        <button onClick={this.displayJson}>Click</button>
      </div>
    );
  }
}


export default App;
